自分に問いかけながら、葛藤しながら
自分にしか出せない線で表現したい。

時には孤独を感じながら、
またその孤独と向き合い、孤独を楽しんでいる自分がいます。

私の内なるものとの会話です。

線質はその人を表します。
どれだけ強く書きたいと思っても、
その人の内側に強さがないと
強い線質は出せません。

どれだけ、しなやかにエレガントな線を
書きたいと思っても、その人の内側にしなやかさやエレガントさが無ければ、そんな線質は出せません。

だから、私は常日頃、
日常を大事にしたいと思っています。

それが、そのまま写し出されます。

